INSERT INTO `pages` VALUES (1,'static','Remoddo | The Shared Wardrobe',NULL,'Remodo | The Shared Wardrobe','/',NULL,'Remoddo | The Shared Wardrobe','2023-01-11 08:40:39','2023-05-21 17:33:34'),(2,'published','What is our mission','What is our mission','What is our mission | Laravel','what-is-our-mission','<h5 style=\"border: 0px solid rgb(217, 217, 227); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(69,89,164,.5); --tw-ring-offset-shadow: 0 0 transparent; --tw-ring-shadow: 0 0 transparent; --tw-shadow: 0 0 transparent; --tw-shadow-colored: 0 0 transparent; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; margin: 1.25em 0px; font-family: Söhne, ui-sans-serif, system-ui, -apple-system, &quot;Segoe UI&quot;, Roboto, Ubuntu, Cantarell, &quot;Noto Sans&quot;, sans-serif, &quot;Helvetica Neue&quot;, Arial, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; white-space-collapse: preserve;\"><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); white-space-collapse: collapse;\"><span style=\"font-size: 14pt; font-family: Helvetica;\"><span style=\"font-family: Helvetica;\">At Remoddo, our mission is to revolutionize the way we approach fashion by promoting the circular economy and combating the negative impacts of fast fashion. We believe that fashion should be both sustainable and accessible, allowing individuals to express their style while minimizing waste and environmental harm.</span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); white-space-collapse: collapse;\"><span style=\"font-size: 14pt; font-family: Helvetica;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); white-space-collapse: collapse;\"><span style=\"font-size: 14pt; font-family: Helvetica;\"><span style=\"font-family: Helvetica;\">Our platform is designed to empower users to participate in a new way of consuming fashion. Instead of buying clothing items that may only be worn a few times, our lending model allows individuals to borrow high-quality garments for special occasions, everyday wear, or experimentation with new styles. By enabling the sharing and reusing of fashion items, we aim to reduce the need for excessive production and contribute to a more sustainable future.</span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); white-space-collapse: collapse;\"><span style=\"font-size: 14pt; font-family: Helvetica;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); white-space-collapse: collapse;\"><span style=\"font-size: 14pt; font-family: Helvetica;\"><span style=\"font-family: Helvetica;\">Our goal is to create a fashion ecosystem where consumers can enjoy the latest trends, experiment with styles, and express themselves without contributing to the harmful cycle of fast fashion. We believe that by rethinking our relationship with fashion and embracing a circular approach, we can contribute to a more sustainable and environmentally friendly future while still celebrating individuality and personal style.</span></span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); white-space-collapse: collapse;\"><span style=\"font-size: 14pt; font-family: Helvetica;\"><span style=\"font-family: Helvetica;\"><br></span></span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); white-space-collapse: collapse;\"><span style=\"font-size: 14pt; font-family: Helvetica;\"><span style=\"font-family: Helvetica;\">Join us on our mission to redefine fashion consumption and create a more conscious and compassionate fashion industry.</span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); white-space-collapse: collapse;\"><br></p></h5>','What is our mission | Laravel','2023-01-11 08:40:39','2023-06-16 15:37:20'),(5,'published','About Us','About Us','About Us','about-us','<h3 style=\"text-align: left;\"><font color=\"#000000\" style=\"background-color: rgb(255, 255, 255);\">In a world saturated with fast fashion and disposable trends, Roham and Rahemi saw an opportunity to revolutionise the way we consume and experience fashion. Fuelled by their shared passion for sustainability and accessibility, they created Remoddo. An innovative online marketplace that connects fashion enthusiasts and empowers them to lend and rent clothing by celebrating individuality and fostering a sense of community.&nbsp;</font></h3>','About Us | Laravel','2023-01-11 08:40:39','2023-06-16 15:14:44'),(7,'published','Contact Us','Contact Us','Contact Us | Laravel','contact-us','<p>If you are having issues with an order, use the Open Dispute in button&nbsp;<span style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 1rem;\"=\"\">on your order&nbsp;</span><span style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 1rem;\"=\"\">and a customer support representative will be in touch.&nbsp;</span></p><p>For other enquiries, you can contact us at&nbsp;<span style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 1rem;\"=\"\">Remoddosupport@gmail.com</span></p><p><span style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 1rem;\"=\"\">We aim to get back to you within 24 hours.&nbsp;</span></p>','Contact Us | Laravel','2023-01-11 08:40:39','2023-06-16 15:40:10'),(8,'published','Sustainability','Sustainability','Sustainability | Laravel','sustainability','<p>Sustainability is at the heart of Remoddo. Our fundamental goal is to deliver Sustainability to an industry which so painfully needs it.&nbsp;</p><p><br></p><p>The Fashion Industry is amongst one of the largest polluters worldwide. It is an industry which has embedded within it the cycle of Buy -&gt; Wear -&gt; Throw it in your wardrobe never to be seen again. Whilst other industries are implementing sustainability strategies, the Fashion Industry is falling behind. We refute the idea that clothes are disposable and for one time use only, because why should it be when you can share your wardrobe, elevate your style and embrace sustainability?</p><p><br></p><p>We want fashion to be fun. We want to celebrate individuality. We want fashion to reflect your personality. We want fashion to be Sustainable.</p><p><br></p><h4><font color=\"#000000\" style=\"\"><b>The Shared Wardrobe is at your fingertips. Why buy when you can borrow.</b></font></h4><p><br></p><p><br></p>','Sustainability | Laravel','2023-01-11 08:40:39','2023-05-20 20:30:12'),(9,'published','Terms of Service','Terms of Service','Terms of Service | Laravel','terms-of-service','<p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">These Terms of Service (\"Terms\") govern your use of the Remoddo website (the \"Website\") provided by Remoddo (\"Remoddo,\" \"we,\" \"us,\" or \"our\"). By accessing or using the Website, you agree to be bound by these Terms. If you do not agree to these Terms, please refrain from using the Website.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">User Responsibilities<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">1.1. Eligibility: You must be at least 18 years old and capable of entering into a legally binding agreement to use the Website. By accessing the Website, you represent and warrant that you meet these requirements.<o:p></o:p></span></p><