class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">2.3. Third-Party Links: The Website may contain links to third-party websites. Remoddo does not endorse or control these websites and is not responsible for their content or any damages or losses incurred through your use of such websites.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">Intellectual Property<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">3.1. Ownership: All intellectual property rights, including copyrights, trademarks, and any other proprietary rights, in the Website and its content belong to Remoddo or its licensors. These Terms do not grant you any rights to use Remoddo\'s intellectual property, except as expressly authorized.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">3.2. Feedback: If you provide any feedback or suggestions regarding the Website, you grant Remoddo a non-exclusive, perpetual, irrevocable, royalty-free, worldwide license to use, modify, and incorporate such feedback without any obligation to compensate you.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">Limitation of Liability<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">To the extent permitted by applicable law, Remoddo shall not be liable for any direct, indirect, incidental, consequential, or punitive damages arising out of or in connection with your use of the Website or these Terms.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">Termination<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">Remoddo may terminate or suspend your access to the Website at any time and without prior notice if you violate these Terms or for any other reason at our sole discretion.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">Governing Law<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">These Terms shall be governed by and construed in accordance with the laws of the United Kingdom. Any disputes arising out of or in connection with these Terms shall be subject to the exclusive jurisdiction of the courts in the United Kingdom.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">By accessing and using the Remoddo Website, you acknowledge that you have read, understood, and agree to be bound by these Terms of Service. If you do not agree with any provision of these Terms, please refrain from using the Website.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica;\">&nbsp;</span></p>','Terms of Service | Laravel','2023-01-11 08:40:39','2023-06-23 18:45:43'),(10,'published','Privacy Policy','Privacy Policy','Privacy Policy | Laravel','privacy-policy','<div>Privacy Policy</div><div><br></div><div>Effective Date: [Insert Date]</div><div><br></div><div>This Privacy Policy describes how Remoddo collects, uses, shares, and protects personal information collected from users of our fashion rental marketplace website (\"Website\"). We are committed to protecting your privacy and ensuring the security of your personal information. By accessing or using our Website, you consent to the practices outlined in this Policy.</div><div><br></div><div>1. Information We Collect</div><div>We may collect the following types of personal information from you:</div><div><br></div><div>a) Personal Information: When you create an account, make a rental reservation, or engage in any transaction on our Website, we may collect personal information such as your name, email address, phone number, shipping address, payment details, and other information necessary to facilitate the rental process.</div><div><br></div><div>b) User Communications: We may collect any information you voluntarily provide to us when you communicate with us via email, chat, or other forms of communication.</div><div><br></div><div>c) Usage Information: We automatically collect certain information about your interactions with our Website, such as your IP address, browser type, device information, operating system, pages viewed, and referring website. This information helps us analyse trends, administer the Website, and improve our services.</div><div><br></div><div>2. How We Use Your Information</div><div>We use the collected personal information for the following purposes:</div><div><br></div><div>a) Rental Services: To process and fulfil rental orders, manage reservations, facilitate transactions, and provide customer support related to your rentals.</div><div><br></div><div>b) Account Management: To create and manage your user account, including account authentication, password reset, and communication regarding your account status.</div><div><br></div><div>c) Communication: To respond to your inquiries, provide updates and notifications about our services, and send you marketing and promotional materials, subject to your preferences and applicable laws.</div><div><br></div><div>d) Improve User Experience: To enhance and personalise your experience on our Website, optimise content, and provide recommendations based on your preferences and rental history.</div><div><br></div><div>e) Analytics and Research: To analyse user behaviour, track Website performance, and conduct research to improve our services, marketing strategies, and overall user experience.</div><div><br></div><div>f) Compliance with Laws: To comply with legal obligations, resolve disputes, enforce our terms of service, and protect our rights and the rights of our users.</div><div><br></div><div>3. Data Sharing and Disclosure</div><div>We may share your personal information with third parties in the following circumstances:</div><div><br></div><div>a) Service Providers: We may share your information with trusted third-party service providers who assist us in operating our Website, processing payments, conducting data analysis, or performing other essential business functions. These service providers are contractually obligated to protect your personal information and are prohibited from using it for any other purpose.</div><div><br></div><div>b) Legal Compliance: We may disclose your information when required by law, court order, or governmental authority, or when we believe in good faith that such disclosure is necessary to protect our rights, investigate fraud, or respond to a legal request.</div><div><br></div><div>c) Business Transfers: In the event of a merger, acquisition, or sale of all or a portion of our assets, your personal information may be transferred to the acquiring entity or parties involved in the transaction. We will notify you via email or prominent notice on our Website if such a transfer occurs and inform you of any choices you may have regarding your personal information.</div><div><br></div><div>4. Data Security</div><div>We implement industry-standard security measures to protect your personal information from unauthorised access, loss, misuse, or alteration. However, please be aware that no method of transmission over the Internet or electronic storage is 100% secure. Therefore, we cannot guarantee absolute security of your personal information.</div><div><br></div><div>5. Your Rights and Choices</div><div>a) Account Information: You have the right to access, update, and correct your personal information provided on our Website. You can review and edit your account details by logging into your user account on Remoddo</div>','Privacy Policy | Laravel','2023-01-11 08:40:39','2023-05-20 18:05:19'),(11,'published','Cookie Policy','Cookie Policy','Cookie Policy | Laravel','cookie-policy','<div>Cookie Policy</div><div><br></div><div>Effective Date: [20/05/2023]</div><div><br></div><div>This Cookie Policy (\"Policy\") describes how cookies and similar technologies are used on [Your Website Domain] (\"Website\") and how your personal information may be collected, used, and disclosed when you visit or interact with our Website. This Policy should be read in conjunction with our Privacy Policy.</div><div><br></div><div>1. What are Cookies?</div><div>Cookies are small text files that are placed on your device (computer, tablet, or mobile) when you visit our Website. They enable our Website to recognize your device and store certain information about your preferences or past actions.</div><div><br></div><div>2. Types of Cookies Used</div><div>We use the following types of cookies on our Website:</div><div><br></div><div>a) Essential Cookies: These cookies are necessary for the functioning of our Website and enable you to navigate and use its features. They are usually set in response to your actions, such as filling out forms, making selections, or setting preferences. Without these cookies, certain parts of our Website may not function properly.</div><div><br></div><div>b) Analytics Cookies: These cookies collect information about how visitors use our Website, such as the pages visited, the time spent on each page, and any error messages encountered. This data helps us improve the performance and usability of our Website. We use third-party analytics services to collect and analyze this information.</div><div><br></div><div>c) Advertising Cookies: These cookies track your browsing habits and enable us to deliver targeted advertisements that are relevant to your interests. They may also be used to limit the number of times you see an ad and measure the effectiveness of our advertising campaigns. These cookies are placed by third-party advertising networks with our permission.</div><div><br></div><div>d) Social Media Cookies: Our Website may include social media features or plugins that allow you to share content or interact with social media platforms. These features may set cookies to track your interactions with social media platforms or personalize your experience based on your preferences.</div><div><br></div><div>3. Your Consent</div><div>By continuing to use our Website, you consent to the use of cookies as described in this Policy. You can manage your cookie preferences by adjusting the settings in your browser or device. However, please note that blocking or disabling certain types of cookies may impact the functionality and performance of our Website.</div><div><br></div><div>4. Third-Party Cookies</div><div>Some of the cookies used on our Website may be placed by third-party service providers, such as analytics and advertising networks. These third parties may collect information about your online activities over time and across different websites. We do not have control over the cookies placed by these third parties and their use is subject to their respective privacy policies.</div><div><br></div><div>5. Data Sharing and Disclosure</div><div>We may share your personal information collected through cookies with trusted third parties, including service providers and partners, as outlined in our Privacy Policy.</div><div><br></div><div>6. Changes to this Policy</div><div>We reserve the right to modify or update this Cookie Policy from time to time to reflect changes in our practices or applicable laws. Any updates will be posted on this page with a revised \"Effective Date.\"</div><div><br></div><div>7. Contact Us</div><div>If you have any questions or concerns about our use of cookies or this Cookie Policy, please contact us at remoddosupport@remoddo.com</div><div><br></div><div>By using our Website, you acknowledge that you have read and understood this Cookie Policy and consent to the use of cookies as described herein.</div><div><br></div><div>Last updated: [20/05/2023]</div>','Cookie Policy | Laravel','2023-01-11 08:40:39','2023-05-21 17:38:15');
INSERT INTO `pages` VALUES (12,'published','HOW IT WORKS',NULL,NULL,'how-it-works','<p><span style=\"font-family: Helvetica;\">﻿</span><b>&nbsp;</b></p><p><span style=\"font-weight: bolder; font-size: 12pt; color: rgb(0, 0, 0); font-family: Calibri, sans-serif;\"><span style=\"font-family: Helvetica; color: rgb(33, 37, 41);\">1. <u>Browse for your desired item</u></span></span></p><p><span style=\"font-weight: bolder; font-size: 12pt; color: rgb(0, 0, 0); font-family: Calibri, sans-serif;\"><span style=\"font-family: Helvetica; color: rgb(33, 37, 41);\"><br></span></span></p><h4><span style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 1rem;\"=\"\">&nbsp;</span><img src=\"data:image/png;base64,\" data-filename=\"21424.png\" style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 1rem;=\"\" width:=\"\" 50%;\"=\"\"><span style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 1rem;\"=\"\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><br></h4><p><span style=\"font-weight: bolder; font-family: \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 1rem;\"=\"\">&nbsp;</span></p><span style=\"color: rgb(0, 0, 0); font-size: medium;\"></span><p><b style=\"color: rgb(0, 0, 0); font-family: Calibri, sans-serif; font-size: 12pt;\"><span style=\"font-family: Helvetica; color: rgb(33, 37, 41);\">2. <u>Request to rent your chosen item</u></span></b></p><p><span style=\"color: inherit; font-size: 18pt; font-family: \" source=\"\" sans=\"\" pro\",=\"\" sans-serif;\"=\"\"><br></span><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 50%;\"><span style=\"color: inherit; font-size: 18pt; font-family: \" source=\"\" sans=\"\" pro\",=\"\" sans-serif;\"=\"\"><br></span></p><p><span style=\"font-weight: bolder;\"><br></span></p><p><b style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" medium;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\"><span style=\"font-size: 12pt; font-family: Helvetica; color: rgb(33, 37, 41);\">3. <u>Love it, Use it, Treat it like it\'s yours</u></span></b><b style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" medium;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\"><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(33, 37, 41);\">&nbsp;</span></b><b style=\"font-size: 12pt; color: rgb(0, 0, 0); font-family: Calibri, sans-serif;\"><span style=\"font-size: 18pt; font-family: \" source=\"\" sans=\"\" pro\",=\"\" sans-serif;=\"\" color:=\"\" rgb(33,=\"\" 37,=\"\" 41);\"=\"\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></b><br></p><p><img src=\"data:image/png;base64,\" data-filename=\"232.png\" style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 1rem;=\"\" width:=\"\" 50%;\"=\"\"><br></p><p><b><br></b></p><p><b><br></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><b><span style=\"font-family: Helvetica; color: rgb(33, 37, 41);\">&nbsp;4.&nbsp;<u>Return to Lender on time</u><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><br></p><p>&nbsp;<img src=\"data:image/png;base64,\" data-filename=\"34123.png\" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 1rem;=\"\" width:=\"\" 25%;\"=\"\" style=\"width: 50%;\" 50%;\"=\"\"><br></p>',NULL,'2023-05-20 18:55:31','2023-06-16 16:02:33');
INSERT INTO `pages` VALUES (13,'published','FAQs',NULL,NULL,'FAQS','<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 36pt; font-family: Helvetica; color: rgb(33, 37, 41);\"><br></span></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b style=\"font-size: 12pt;\"><span style=\"font-size: 36pt; font-family: Helvetica; color: rgb(33, 37, 41);\">Renting</span></b><br></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" sans-serif;=\"\" color:=\"\" rgb(33,=\"\" 37,=\"\" 41);\"=\"\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" sans-serif;=\"\" color:=\"\" rgb(33,=\"\" 37,=\"\" 41);\"=\"\"><br></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\">How to get started?<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">The first step is to sign up if you haven’t already. You can then use the search bar or navigate our category tabs to find your desired item.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">On the listing you can find all the rental information like the different durations for rent and their respective cost.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">The deposit amount is also highlighted. This is posted as a pending charge on your payment card until the item is returned and received by the lender.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">Here you can also see details of the item such as size and a brief description.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">You can add to you likes or press a rental duration and be taken to the checkout process.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\">Checkout<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">Fill in your address and payment details and review your rental summary to verify everything.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">Your request will be sent to the lender and now you just have to wait for them to accept!<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">Once accepted, the lender will dispatch your order and provide tracking details via chat.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\">Unexpected problems<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">If you experience any issues with your rental, such as receiving something you did not expect or a late delivery then you can open a dispute from your order details page and a member of staff will join the chat to assist.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\">Returning your rental<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">The order summary will display the “Return by date”. Please navigate to your orders and press the Send Back button on or before this date. You will then be provided with the lender’s address. You must use a tracked service and provide the tracking number to the lender via chat.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 26pt; font-family: \" source=\"\" sans=\"\" pro\",=\"\" sans-serif;=\"\" color:=\"\" rgb(33,=\"\" 37,=\"\" 41);\"=\"\"><br></span></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 26pt; font-family: \" source=\"\" sans=\"\" pro\",=\"\" sans-serif;=\"\" color:=\"\" rgb(33,=\"\" 37,=\"\" 41);\"=\"\"><br></span></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 26pt; font-family: \" source=\"\" sans=\"\" pro\",=\"\" sans-serif;=\"\" color:=\"\" rgb(33,=\"\" 37,=\"\" 41);\"=\"\">Delivery &amp; Tracking<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\"><br>How do I track my delivery?<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">The lender will provide tracking details via chat. If they haven’t done this, you can reach out to them and enquire.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\">What if my rental arrives late?<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">If your rental has arrived later than the date specified on the order, you can chat to the lender and reach a solution such as<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin: 0cm 0cm 8.05pt 36pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Symbol; color: rgb(36, 30, 25);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">Returning the rental later to make up for the lost time<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0cm 0cm 8.05pt 36pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">&nbsp;</span></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin: 0cm 0cm 8.05pt 36pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Symbol; color: rgb(36, 30, 25);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">Receiving a partial refund equal to the time missed<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">If that doesn’t work, then please use the <b>open dispute</b> button within My Rental and a member of staff will assist. In this case a partial refund is the likely outcome.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 26pt; font-family: \" source=\"\" sans=\"\" pro\",=\"\" sans-serif;=\"\" color:=\"\" rgb(33,=\"\" 37,=\"\" 41);\"=\"\">Returns &amp; Disputes</span></b><span style=\"font-size: 14pt; font-family: Helvetica; color: rgb(36, 30, 25);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\"><br>I have received a damaged/different item, what do I do?<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">You must take a photo and contact the lender within 24 hours of receiving the item.<br>If you are not able to come to a solution with the lender then please use the <b>open dispute</b> button within My Rental and a member of staff will assist.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\">What if the item does not fit?<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">Please navigate to your order page and open a dispute as soon as possible citing the reason “item does not fit” after receiving the item.<br>A member of staff will facilitate a full refund only if you are able to post back the rental the following day using next day delivery and provide tracking to the lender via chat.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 14pt; font-family: Helvetica; color: rgb(36, 30, 25);\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\">How do I return my rental?</span></b><span style=\"font-size: 14pt; font-family: Helvetica; color: rgb(36, 30, 25);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">The order summary will display the “Return by date”.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">Please navigate to your orders and press the Send Back button on or before this date. You will then be provided with the lender’s address. You must use a tracked service and provide the tracking number to the lender via chat.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 14pt; font-family: Helvetica; color: rgb(36, 30, 25);\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\">How do I cancel a rental?<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 14pt; font-family: Helvetica; color: rgb(36, 30, 25);\"><br></span></b><b><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">If the rental request hasn’t been accepted yet<br></span></b><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">Message the lender and ask them to reject the request.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">After your rental request has been accepted<br></span></b><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">Message the lender and request to cancel. They can do so if they have not yet dispatched the order.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 14pt; font-family: Helvetica; color: rgb(36, 30, 25);\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 14pt; font-family: Helvetica; color: rgb(36, 30, 25);\"><br></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 36pt; font-family: Helvetica;\"><br></span></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 36pt; font-family: Helvetica;\">Lending</span></b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 16pt;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 16pt; font-family: Helvetica;\">How to get started?</span></b><b><o:p></o:p></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt 36pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica;\">1.</span><span style=\"font-size: 7pt; font-family: Helvetica;\">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: Helvetica;\">The first step is to sign up if you haven’t already. Then, go into your profile and ensure you are on ‘Lend’ mode and click on post listing. Please ensure that all product information is provided, including the brand name, size, and fit. Include as much detail here as possible so the renter knows exactly what they are renting. If there are any minor imperfections, please photograph them and provide a detailed description.</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt 36pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica;\">2.</span><span style=\"font-size: 7pt; font-family: Helvetica;\">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: Helvetica;\">Then, upload photos of the item, capturing the current condition and any imperfections that the item may have. It is important that the renter is aware of any existing flaws to the item.</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt 36pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica;\">3.</span><span style=\"font-size: 7pt; font-family: Helvetica;\">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: Helvetica;\">Set your price and let the renting begin!</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 16pt; font-family: Helvetica;\">What items can I list?</span></b><b><o:p></o:p></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica;\">You are able to list most items of that clothing you desire! We do not have restrictions on brand, price of item or age of item.</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica;\">We just ask that you think carefully about the items you wish to list. If you have your favourite necklace which is irreplaceable and was gifted to you by your grandma…we would probably advise you to not list that.</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica;\">We want a platform which fosters community so please be transparent in your listings and list items as accurately as you can.</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica;\">Our only restrictions are:</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt 36pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">-<span style=\"font-size: 7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: Helvetica;\">Items that promote harmful messages</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt 36pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">-<span style=\"font-size: 7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: Helvetica;\">Items with inappropriate images or messages</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt 36pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">-<span style=\"font-size: 7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: Helvetica;\">Items that are counterfeit</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica;\">We deserve the right to remove or edit any listings that we deem to be counterfeit, illegal, inappropriate, harmful or unsuitable. We will always let you know the reason for removal of an item from our website.</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt 36pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><br><br><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 16pt; font-family: Helvetica;\">What photos should I upload?</span></b><b><o:p></o:p></b></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 16pt; font-family: Helvetica;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica;\">Having many informative photos and ensuring their quality will help you attract a buyer’s attention.</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica;\">Here are the things to keep in mind when taking photos and adding them to your listing:</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica;\">&nbsp;</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt 36pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">-<span style=\"font-size: 7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: Helvetica;\">First photo = best photo. Use the best shot you have available of your item as your first photo. Make sure it is a clear photo which captures the item adequately.</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt 36pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">-<span style=\"font-size: 7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: Helvetica;\">Add photos taken from different angles for completeness</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt 36pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">-<span style=\"font-size: 7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: Helvetica;\">Add photos of the inside tag of the item</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt 36pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">-<span style=\"font-size: 7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: Helvetica;\">Add photos of defects so the renter knows what to expect when they receive their item</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt 36pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">-<span style=\"font-size: 7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: Helvetica;\">Add photos of detailed close-ups of significant features that may not be readily visible in other images. These could include the item\'s logo, care label, stitching, or any other details you deem to be relevant</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt 36pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">-<span style=\"font-size: 7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family: Helvetica;\">Lastly, we know filters are fun but we want accuracy of items so refrain from adding filters and editing your photos.</span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt 36pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica;\"><br></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-weight: bolder;\"><span style=\"font-size: 36pt; font-family: Helvetica; color: rgb(33, 37, 41);\"><br></span></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-weight: bolder;\"><span style=\"font-size: 36pt; font-family: Helvetica; color: rgb(33, 37, 41);\">My Remoddo<o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-size: 14pt; font-family: Helvetica; color: rgb(36, 30, 25);\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 8.05pt; font-size: 12pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-weight: bolder;\"><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\">How do I create an account?</span></span><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">Click on signup at the top of the page and provide the required details.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt 36pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">Once signed up, you will have access to both your renting and lending dashboard.<o:p></o:p></span></p><div><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\"><br></span></div><div><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: medium; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);\"><b><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\">What if I forgot my password?</span></b><span style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; color: rgb(33, 37, 41);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: medium; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);\"><span style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; color: rgb(33, 37, 41);\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: medium; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">Use the forgot password prompt and follow the instructions to reset your password.&nbsp;</span><span style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; color: rgb(33, 37, 41);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: medium; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);\"><span style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; color: rgb(33, 37, 41);\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: medium; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);\"><b><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\">How do I delete my account?</span></b><span style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; color: rgb(33, 37, 41);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: medium; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">Please get in touch with us if you would like to terminate your account.&nbsp;</span><span style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; color: rgb(33, 37, 41);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: medium; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">&nbsp;</span><b><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\"><br>How do I leave or receive a review?&nbsp;</span></b><span style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; color: rgb(33, 37, 41);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: medium; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">As a renter, you are able to leave a review after you have sent back the item. The button will appear on your orders page. The same will occur for the lender after the return has been sent.&nbsp;</span><span style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; color: rgb(33, 37, 41);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: medium; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);\"><b><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\"><br></span></b><b><span style=\"font-size: 36pt; font-family: Helvetica; color: rgb(36, 30, 25);\">Fees &amp; Payments</span></b><span style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; color: rgb(33, 37, 41);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: medium; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);\"><span style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; color: rgb(33, 37, 41);\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: medium; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);\"><b><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\">Late Fees&nbsp;<br></span></b><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">A fee equal to 30% of the rental total is applicable for every day a rental return is late. Please make sure to return your rentals on time!</span><b><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\">&nbsp;</span></b><span style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; color: rgb(33, 37, 41);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: medium; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);\"><b><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\"><br><br></span></b><span style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; color: rgb(33, 37, 41);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: medium; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);\"><b><span style=\"font-size: 16pt; font-family: Helvetica; color: rgb(36, 30, 25);\">Pending charge&nbsp;<br></span></b><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\">A pending charge is placed on the renter\'s card equal to 30% of the order. This charge is dropped once, the item has been returned to the lender.&nbsp;</span><span style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; color: rgb(33, 37, 41);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; font-size: medium; font-family: Calibri, sans-serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);\"><span style=\"font-family: Helvetica; color: rgb(36, 30, 25);\"><br><br></span><span style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; color: rgb(33, 37, 41);\"><o:p></o:p></span></p></div>',NULL,'2023-05-20 18:59:18','2023-06-29 19:01:14');
